import React from "react";
import "./AboutMe.css";

export default function AboutMe() {
  return (
    <div className="aboutme">
      <div className="wrapper">
        <div className="a-img">
          <img src="Assets/Skills/aboutme.jpg" />
        </div>
      </div>
    </div>
  );
}
